import { BrowserRouter, Route, Routes } from "react-router-dom";
import { AuthProvider } from '.Components/AuthContext';
import ProtectedRoute from './ProtectedRoute';
import Assignment from "./Components/Assignment";
import Login from "./Components/Login";
import Signup from "./Components/SignUp";
import TaskForm from "./Components/TaskForm";
import TaskList from "./Components/TaskList";
import Userlist from "./Components/Userlist";
import Home from "./Components/Home";
import TaskPage from "./Components/TaskPage";
import './App.css';

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/tasklist" element={<ProtectedRoute><TaskList /></ProtectedRoute>} />
          <Route path="/userlist" element={<ProtectedRoute><Userlist /></ProtectedRoute>} />
          <Route path="/assignment" element={<ProtectedRoute><Assignment /></ProtectedRoute>} />
          <Route path="/taskform" element={<ProtectedRoute><TaskForm /></ProtectedRoute>} />
          <Route path="/taskpage" element={<ProtectedRoute><TaskPage /></ProtectedRoute>} />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
